import React, { useEffect, useState } from 'react';
import './Tile.scss';
import ieLogo from '../../assets/ieLogo.png';
import chromeLogo from '../../assets/chromeLogo.png';
import { TileContainer } from './styles';

function Tile({color, coord, isFocusTile, hasChecker, tileClicked}) {

  const toggleFocus = () => {
    tileClicked(coord);
  }

  return (
    <TileContainer color={color} isFocusTile={isFocusTile(coord)}
        onClick={toggleFocus}
    >
      <p className="label">{`${coord[0]}, ${coord[1]}`}</p> 
      {hasChecker ? <CheckerPiece className="tile__checker" src={hasChecker == 1 ? chromeLogo : ieLogo} /> : ''}
    </TileContainer>
  );
}

export default Tile;
